import React from "react";

import "./button.scss";

interface IProps {
  store?: any;
  text?: string;
}

const Button: React.FC<IProps> = ({ store, children, text }) => {
  return (
    <div>
      <button>{children}</button>
    </div>
  );
};

export default Button;
